import styled from 'styled-components';

export const Header = styled.section`
  width: 100%;
  height: 65px;
  border-bottom: 3px solid rgb(243, 243, 243, 0.6);
  display: flex;
  justify-content: space-around;
  align-items: center;
`;

export const Logo = styled.div`
  width: 30%;
  font-size: 2rem;
`;

export const Login = styled.div`
  width: 20px;
  height: 20px;
`;
